import React, { useEffect, useRef } from 'react';
import './Experience.css';
import { FaBriefcase, FaCode, FaChartLine } from 'react-icons/fa';
import company1Pic from '../images/company1.jpg';
import company2Pic from '../images/company2.jpg';
import company3Pic from '../images/company3.jpg';

function Experience() {
  const sectionRefs = useRef([]);

  useEffect(() => {
    const observerOptions = {
      root: null,
      rootMargin: '0px',
      threshold: 0.1
    };

    const observerCallback = (entries) => {
      entries.forEach((entry) => {
        if (entry.isIntersecting) {
          entry.target.classList.add('animate');
        }
      });
    };

    const observer = new IntersectionObserver(observerCallback, observerOptions);

    sectionRefs.current.forEach((ref) => {
      if (ref) observer.observe(ref);
    });

    return () => {
      sectionRefs.current.forEach((ref) => {
        if (ref) observer.unobserve(ref);
      });
    };
  }, []);

  return (
    <div className="experience-container">
      <h2>Professional Experience</h2>

      <div ref={el => sectionRefs.current.push(el)} className="info-section section">
        <div className="experience-item">
          <div className="experience-image-container">
            <img src={company1Pic} alt="Company 1" className="experience-image" />
          </div>
          <div className="experience-content">
            <FaBriefcase className="experience-icon" />
            <h3>Senior Software Engineer</h3>
            <h4>Company Name 1</h4>
            <p>January 2020 - Present</p>
            <ul>
              <li>Led the development of a critical healthcare application, improving patient data management efficiency by 40%.</li>
              <li>Implemented machine learning algorithms for predictive analytics in patient care.</li>
              <li>Mentored junior developers, improving team productivity by 25%.</li>
            </ul>
          </div>
        </div>
      </div>

      <div ref={el => sectionRefs.current.push(el)} className="info-section section">
        <div className="experience-item">
          <div className="experience-image-container">
            <img src={company2Pic} alt="Company 2" className="experience-image" />
          </div>
          <div className="experience-content">
            <FaCode className="experience-icon" />
            <h3>Full Stack Developer</h3>
            <h4>Company Name 2</h4>
            <p>June 2017 - December 2019</p>
            <ul>
              <li>Developed and maintained multiple web applications using React and Node.js.</li>
              <li>Optimized database queries, reducing load times by 50%.</li>
              <li>Implemented automated testing, increasing code coverage to 90%.</li>
            </ul>
          </div>
        </div>
      </div>

      <div ref={el => sectionRefs.current.push(el)} className="info-section section">
        <div className="experience-item">
          <div className="experience-image-container">
            <img src={company3Pic} alt="Company 3" className="experience-image" />
          </div>
          <div className="experience-content">
            <FaChartLine className="experience-icon" />
            <h3>Data Analyst Intern</h3>
            <h4>Company Name 3</h4>
            <p>May 2016 - August 2016</p>
            <ul>
              <li>Analyzed large datasets to identify trends and provide insights for business decisions.</li>
              <li>Created data visualization dashboards using Tableau.</li>
              <li>Assisted in the development of predictive models for sales forecasting.</li>
            </ul>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Experience;
